import React, {Component} from 'react'


class RegPago extends Component{
    render(){
        return(
            <li>
                <div className="icon">
                    <img src={this.props.logo}  alt="Pay" />
                </div>
                <div className="Date">
                    <span className="item-name">{this.props.date}</span>
                </div>
                <div className="price">
                    <h3>${this.props.price}</h3>
                </div>
            </li>
        )
    }
}
export default RegPago
